--------------------------------------------------------
--  DDL for Package Body PGK_NUMERO_LETRA
--------------------------------------------------------

  CREATE OR REPLACE PACKAGE BODY "REC01"."PGK_NUMERO_LETRA" 
AS
-----------------------------------------------------------------
--Convierte las unidades en su correspondiente valor en letras
-----------------------------------------------------------------
   FUNCTION unidad (p_unidad IN NUMBER, p_decena IN NUMBER)
      RETURN VARCHAR2
   AS
      v_texto   VARCHAR2 (50);
   BEGIN
      IF p_decena <> 1
      THEN
         CASE p_unidad
            WHEN 1
            THEN
               v_texto := 'Un ';
            WHEN 2
            THEN
               v_texto := 'Dos ';
            WHEN 3
            THEN
               v_texto := 'Tres ';
            WHEN 4
            THEN
               v_texto := 'Cuatro ';
            WHEN 5
            THEN
               v_texto := 'Cinco ';
            ELSE
               NULL;
         END CASE;
      END IF;

      CASE p_unidad
         WHEN 6
         THEN
            v_texto := 'Seis ';
         WHEN 7
         THEN
            v_texto := 'Siete ';
         WHEN 8
         THEN
            v_texto := 'Ocho ';
         WHEN 9
         THEN
            v_texto := 'Nueve ';
         ELSE
            NULL;
      END CASE;

      RETURN v_texto;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         NULL;
      WHEN OTHERS
      THEN
         RAISE;
   END unidad;

-----------------------------------------------------------------
--Convierte las decenas en su correspondiente valor en letras
-----------------------------------------------------------------
   FUNCTION decena (p_unidad IN NUMBER, p_decena IN NUMBER)
      RETURN VARCHAR2
   AS
      v_texto   VARCHAR2 (50);
   BEGIN
      CASE p_decena
         WHEN 1
         THEN
            CASE p_unidad
               WHEN 0
               THEN
                  v_texto := 'Diez ';
               WHEN 1
               THEN
                  v_texto := 'Once ';
               WHEN 2
               THEN
                  v_texto := 'Doce ';
               WHEN 3
               THEN
                  v_texto := 'Trece ';
               WHEN 4
               THEN
                  v_texto := 'Catorce ';
               WHEN 5
               THEN
                  v_texto := 'Quince ';
               WHEN 6
               THEN
                  v_texto := 'Dieci';
               WHEN 7
               THEN
                  v_texto := 'Dieci';
               WHEN 8
               THEN
                  v_texto := 'Dieci';
               WHEN 9
               THEN
                  v_texto := 'Dieci';
               ELSE
                  NULL;
            END CASE;
         WHEN 2
         THEN
            IF p_unidad = 0
            THEN
               v_texto := 'Veinte ';
            ELSIF p_unidad > 0
            THEN
               v_texto := 'Veinti';
            END IF;
         WHEN 3
         THEN
            v_texto := 'Treinta ';
         WHEN 4
         THEN
            v_texto := 'Cuarenta ';
         WHEN 5
         THEN
            v_texto := 'Cincuenta ';
         WHEN 6
         THEN
            v_texto := 'Sesenta ';
         WHEN 7
         THEN
            v_texto := 'Setenta ';
         WHEN 8
         THEN
            v_texto := 'Ochenta ';
         WHEN 9
         THEN
            v_texto := 'Noventa ';
         ELSE
            v_texto := '';
      END CASE;

      IF p_unidad > 0 AND p_decena > 2
      THEN
         v_texto := NVL (v_texto, '') || 'y ';
      END IF;

      RETURN v_texto;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         NULL;
      WHEN OTHERS
      THEN
         RAISE;
   END decena;

-----------------------------------------------------------------
--Convierte las centenas en su correspondiente valor en letras
-----------------------------------------------------------------
   FUNCTION centena (
      p_unidad    IN   NUMBER,
      p_decena    IN   NUMBER,
      p_centena   IN   NUMBER
   )
      RETURN VARCHAR2
   AS
      v_texto   VARCHAR2 (50);
   BEGIN
      CASE p_centena
         WHEN 1
         THEN
            IF p_decena + p_unidad = 0
            THEN
               v_texto := 'Cien ';
            ELSE
               v_texto := 'Ciento ';
            END IF;
         WHEN 2
         THEN
            v_texto := 'Doscientos ';
         WHEN 3
         THEN
            v_texto := 'Trescientos ';
         WHEN 4
         THEN
            v_texto := 'Cuatrocientos ';
         WHEN 5
         THEN
            v_texto := 'Quinientos ';
         WHEN 6
         THEN
            v_texto := 'Seiscientos ';
         WHEN 7
         THEN
            v_texto := 'Setecientos ';
         WHEN 8
         THEN
            v_texto := 'Ochocientos ';
         WHEN 9
         THEN
            v_texto := 'Novecientos ';
         ELSE
            v_texto := '';
      END CASE;

      RETURN v_texto;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         NULL;
      WHEN OTHERS
      THEN
         RAISE;
   END centena;

-----------------------------------------------------------------
--Convierte las numeros en su correspondiente valor en letras
-----------------------------------------------------------------
   FUNCTION convertir (p_numero FLOAT, p_moneda NUMBER)
      RETURN VARCHAR2
   IS
      v_num_form      VARCHAR2 (22);
      v_cont1         NUMBER;
      v_cont2         NUMBER;
      v_pos_actual    NUMBER;
      v_digi_actual   NUMBER;
      v_centena       NUMBER;
      v_decena        NUMBER;
      v_unidad        NUMBER;
      v_uni_letras    VARCHAR2 (200);
      v_dec_letras    VARCHAR2 (200);
      v_cent_letras   VARCHAR2 (200);
      v_leyenda       VARCHAR2 (200);
      v_leyenda1      VARCHAR2 (200);
      v_num_letras    VARCHAR2 (200);
      v_moneda        VARCHAR2 (50);
      v_moneda2       VARCHAR2 (50);
   BEGIN
      IF p_numero < 0
      THEN
         RETURN 'NUMERO MENOR A CERO';
      END IF;

      --Dar un formato fijo al numero ingresado
      v_num_form := TRIM (TO_CHAR (p_numero, '000000000000000.00'));
      v_cont1 := 1;
      v_pos_actual := 1;
      v_num_letras := '';

      -- Extraer tres digitos a la vez: unidad, decena y centena
      WHILE v_cont1 <= 5
      LOOP
         v_cont2 := 1;

         WHILE v_cont2 <= 3
         LOOP
            --Extrae un digito cada vez de izquierda a derecha
            v_digi_actual := TO_NUMBER (SUBSTR (v_num_form, v_pos_actual, 1));

            CASE v_cont2
               WHEN 1
               THEN
                  v_centena := v_digi_actual;
               WHEN 2
               THEN
                  v_decena := v_digi_actual;
               WHEN 3
               THEN
                  v_unidad := v_digi_actual;
               ELSE
                  NULL;
            END CASE;

            v_cont2 := v_cont2 + 1;
            v_pos_actual := v_pos_actual + 1;
         END LOOP;

         v_cent_letras := centena (v_unidad, v_decena, v_centena);
         v_dec_letras := decena (v_unidad, v_decena);
         v_uni_letras := unidad (v_unidad, v_decena);

         CASE v_cont1
            WHEN 1
            THEN
               IF v_centena + v_decena + v_unidad = 1
               THEN
                  v_leyenda := 'Billon';
               ELSIF v_centena + v_decena + v_unidad > 1
               THEN
                  v_leyenda := 'Billones ';
               END IF;
            WHEN 2
            THEN
               IF     v_centena + v_decena + v_unidad >= 1
                  AND TO_NUMBER (SUBSTR (v_num_form, 7, 3)) = 0
               THEN
                  v_leyenda := 'Mil Millones ';
               ELSIF v_centena + v_decena + v_unidad >= 1
               THEN
                  v_leyenda := 'Mil ';
               END IF;
            WHEN 3
            THEN
               IF v_centena + v_decena = 0 AND v_unidad = 1
               THEN
                  v_leyenda := 'Millon ';
               ELSIF v_centena > 0 OR v_decena > 0 OR v_unidad > 1
               THEN
                  v_leyenda := 'Millones ';
               END IF;
            WHEN 4
            THEN
               IF v_centena + v_decena + v_unidad >= 1
               THEN
                  v_leyenda := 'Mil ';
               END IF;
            WHEN 5
            THEN
               IF v_centena + v_decena + v_unidad >= 1
               THEN
                  v_leyenda := '';
               END IF;
            ELSE
               NULL;
         END CASE;

         v_cont1 := v_cont1 + 1;
         v_num_letras :=
               v_num_letras
            || v_cent_letras
            || v_dec_letras
            || v_uni_letras
            || v_leyenda;
         v_leyenda := '';
         v_uni_letras := '';
         v_dec_letras := '';
         v_cent_letras := '';
      END LOOP;

      -- Concatenar el nombre del tipo de moneda al que hace referencia la cantidad ingresada
      IF p_moneda = 1
      THEN
         v_moneda := 'Quetzales ';
         v_moneda2 := 'Quetzal ';
      ELSIF p_moneda = 2
      THEN
         v_moneda := 'Dolares ';
         v_moneda2 := 'Dolar ';
      END IF;

      IF p_numero = 0 OR p_numero < 1
      THEN
         v_leyenda1 := 'Cero ' || v_moneda;
      ELSIF p_numero = 1 OR p_numero < 2
      THEN
         v_leyenda1 := v_moneda2;
      ELSIF    TO_NUMBER (SUBSTR (v_num_form, 4, 12)) = 0
            OR TO_NUMBER (SUBSTR (v_num_form, 10, 6)) = 0
      THEN
         v_leyenda1 := 'de ' || v_moneda;
      ELSE
         v_leyenda1 := v_moneda;
      END IF;

      v_num_letras :=
         v_num_letras || v_leyenda1 || 'Con ' || SUBSTR (v_num_form, 17)
         || '/100';
      v_num_letras := UPPER (v_num_letras);
      RETURN v_num_letras;
   END convertir;
END pgk_numero_letra; 

